const Footer = () => {
   return (
      <div className="border-top my-2 text-center">
         <span>
            Real<i className="bi bi-geo-fill "></i>App
            <span>&copy;</span>
            <span>{new Date().getFullYear()}</span>
         </span>
      </div>
   );
};

export default Footer;
